INSERT INTO `briefing` (`id`, `body`) VALUES
(1, 'The Georgian military command have requested NATO and NATO-affiliated forces to help secure the Racha-Lechkumi and Kvemo Svaneti areas north of the Georgian capital of Tblisi. The intel is scarce, but there are some reports that Jaamat have a presence in the area. Your mission is to secure and if needed pacify the area, so that the georgian forces can take back control.\r\n\r\nYour will have access to an airbridge in a central part of the theatre of operations, where you can get prisoners airlifted, and receive supplies should they run out. \r\n\r\nThe main task at the start of the operation is to gather intelligence: JITFCOM needs to know the situation on the ground, the civilian presence, any suspect activities or persons of interest, what modes of transport are being utilized and so on. The Georgians also needs to see a presence and a show of strength.'),
(2, 'We’ve been attached to JITFCOM in northern Georgia for a short period of time during OPERATION ICEBREAKER. Sitrep as follows:\r\n\r\nGeorgians believe several islamic militia groups have recently infiltrated the border, primarily from Dagestan and Chechnya. Intel suggests these groups have been hiding out in the mountains, keeping a low profile and focusing on building up stockpiles of ammunition, explosives and weapons. Recently sources in the russian intelligence community have been identifying these groups as belonging to a loose network called the JA’AMAT, controlled by commanders in Dagestan and as far away as Saudi Arabia.\r\nRecently several attacks by this previously dormant network has been carried out, most of them in the northern border regions with Russia, but at least two confirmed bombings have been carried out in the Georgian capital of Tblisi.\r\nGeorgia has requested and received NATO presence on the ground in order to deal with the JA’AMAT problem, as well as a show of force towards Russia, as Georgia fears russian intervention in case terrorists strike across the border into Russia proper. This expeditionary force is comprised primarily of US, UK and Canadian troops, although several other NATO countries are present as well. To further complicate matters a few non NATO-members are present and embedded into the Joint International Task Force under the Partnership For Peace-treaty, primarily Armenian, Austrian and Swedish forces.\r\nUSSOCOM sources claim possible Russian covert special forces activity on the ground. Keep an eye out for Ivan, but do not engage unless in self defense. We don’t want another incident with the Kremlin right now.\r\n\r\nUSSOCOM and UKSF units are operating covertly in the area, under direct JITF command. Your presence is classified and you are operating completely black, reporting only to JITFCOM.\r\n\r\nMission parameters are as follows:\r\nStay low and stay covert\r\nPerform reconnaissance and identify possible Ja’amat militia and HVTs\r\nSupport JITFCOM with reconnaissance, intel and direct action\r\n\r\nPossible further operational parameters include snatch and grab missions, sabotage, EOD, painting targets for laser guided ordnance and collection of intel and evidence.\r\n\r\nYour callsign for this operation is PAPA ROMEO. Your controller for the operation is JITFCOM, callsign PAPA ZERO. Further instructions will be transmitted primarily through ARTEMIS, thereafter cell phone and in emergencies radio.');
