INSERT INTO `intel` (`id`, `title`, `type`, `body`, `sent`, `sent_date`) VALUES
(1, 'HVT GLOWWORM / RADUYEV', 'HUMINT', 'Real name: <b>Shamil Raduyev</b>\r\nAlias: <b>Ramzan Iyardev, al-Musra, Yari</b>\r\nJITF Designation: <b>GLOWWORM</b>\r\nNationality: <b>Chechen</b>\r\nAge: <b>unknown DOB, assumed 35 years old</b>\r\n\r\n<img src="assets/intel/raduyev.jpg">\r\n\r\nShamil Raduyev first came to our notice during the second chechen war, when he sailed up as one of the primary strategists for the chechen insurgency. According to Russian intel Raduyev is not a soldier, but has a very sharp sense for strategy. He lead the infamous “Wolf”-company of jihadists, which continued to operate long after the peace treaty.\r\n\r\nAs far as we can discern Raduyev acted as liason in planning the Beslan hostage action of 2004, and it has been confirmed that large sums of money from tagged Saudi Arabian accounts at this time was transferred to Raduyev.\r\n\r\nIn 2006 Raduyev travelled to the Waziristan region of Pakistan where HUMINT has confirmed that he supervised the training of at least three islamic jihadist groups. During this time Raduyev also tied close bonds with the al-Shara militia of Dagestan. In 2008 intelligence lost Raduyev as he travelled to Dagestan and he did not resurface until 2010, this time in Chechnya.\r\n\r\nRecently our sources say Raduyev is one of five executive leaders for the newly created Jamaat al-Islam. The movement has been very silent, only releasing a few video clips and letters, calling for armed struggle in the caucasus and Georgian border region. SIGINT and CYBINT has been able to penetrate certain communications between Raduyev and a certain “al-Tayub”, which seems to be a Saudi national funding the group. The communications indicate that Raduyev is en route to Georgia in order to activate several local jihadist cells. Intelligence does not indicate any specific targets.\r\n\r\nRaduyev is to be considered a High Value Target of special interest. Capture for interrogation if possible, and secure any and all documents, electronic devices or communications related to Raduyev.\r\n', 1, '2013-11-08 09:16:54'),
(2, 'HVT CINDER / BASAYEV', 'HUMINT', 'Real name: <b>Imran Basayev</B>\r\nAlias: <b>Dugan</b>\r\nJITF Designation: <b>CINDER</B>\r\nNationality: <b>Dagestani</b>\r\nAge: <b>DOB 1978, unknown date</b>\r\n\r\n<img src="assets/intel/imran.jpg">\r\n\r\nBasayev is a Dagestani national. Moved to Camarillo, CA in 2006 to study english, during which time he also took a pilots license. Moved back to Dagestan in late 2009 and became flagged in PRISM intel around 2010 after communications with marked targets in Chechnya. Was arrested in 2010 during an russian FSB raid on a factory but was released after a month since no evidence of his involvement in terrorism could be found.\r\n\r\nIntelligence sources reveal Basayev was recruited by a local Jihadist militia and spent 2010 operating in the mountains of Dagestan. It is confirmed that Basayev took part in at least three attacks on russian FSB troops during 2011, and he seems to have risen in the ranks to become leader for a group known as the “Sayaf al-Islam”. Early 2012 Basayev relocated to Georgia and has since then been tracked by CYBINT measures. Several highly encrypted messages between Basayev and other earmarked targets (SANDWORM, GLOWWORM and SPECTRE) have been verified, but decryption efforts have hitherto failed.\r\n\r\nIn October 2013 Basayev suddenly appeared in the georgian capital of Tblisi. HUMINT was unable to attach assets for survaillance before Basayev disappeared again, but it is believed Basayev was conducting reconnaisance, for unknown purposes.\r\n\r\nBasayev is considered a High Value Target as is wanted for questioning. Capture if possible.\r\n', 1, '2013-11-08 10:03:51'),
(3, 'MISHMASH / NASEER', 'CYBINT', 'CYBINT reports decrypted messages reveal the presence of a certain "NASEER" in the region. Real name unknown. According to decrypted traffic NASEER is an explosives expert from Dagestan attached to Jamaat. \r\n\r\n<img src="assets/intel/mishmash.jpg">\r\n\r\nTraffic reveals NASEER is working on something exceptionally large - analysis propose possible truck loaded ANFO bomb - and should be located in your area. \r\n\r\nWanted for questioning. Capture if possible. Neutralize if capture is impossible.\r\n\r\nDesignation "MISHMASH".', 1, '2013-11-08 16:32:15'),
(4, 'SIGINT FLASH', 'SIGINT', 'SIGINT reports several target cellphone accounts coming online in your region. No more intel at this time, as we are attempting to trace connections, but be aware of possible combatants in your area.', 1, '2013-11-08 16:43:55'),
(5, 'SIGINT FLASH', 'SIGINT', 'SIGINT just pinpointed a suspicious cell phone carrier signal in grid reference 33VVD937792. Will continue to monitor.', 1, '2013-11-08 17:25:29'),
(6, 'USAF FLASH', 'JITFCOM', 'USAF reports losing telemetry from one of their UAVs operating in the area. No more information available at this time, but be alert for enemy Surface-To-Air capabilities or crash sites.', 1, '2013-11-09 01:06:07'),
(7, 'HVT PORCUPINE / DJEJOV', 'HUMINT', 'Real name: <b>Ruslan Djejov</B>\r\nAlias: <b>Wazir</b>\r\nJITF Designation: <b>PORCUPINE</B>\r\nNationality: <b>Dagestani</b>\r\nAge: <b>DOB 1979, unknown date</b>\r\n\r\n<img src="https://scontent-a-ams.xx.fbcdn.net/hphotos-frc1/6768_124545330819_5201673_n.jpg">\r\n\r\nRuslan Djejov is wanted in connection with several assasinations in Chechnya. Handover to russian government after processing. No further intel available.', 1, '2013-11-09 00:00:00'),
(8, 'INTEL FROM HVT GLOWWORM', 'HUMINT', 'Interrogations with the captured HVT GLOWWORM leads us to believe Jamaat will hold a meeting of most operative units at 1630 hours today.\r\n\r\nAccording to the intel extracted from GLOWWORM Jamaat is planning a major operation i Tblisi. The target seems to be Expo 2013, a trade fair in the capital. \r\n\r\nNEW ORDERS: Strike earlier priorities. New priority one is:\r\n\r\n* Move all available assets to the meeting point at grid reference 33VVD937797. \r\n* Sweep and secure area, neutralize any threats and deacommission any ordnance or explosives\r\n* ROE is now updated: you have clearance to use lethal pre-emptive force in order to secure objectives or complete missions.\r\n\r\nSpeed is of the essence, we might only get once chance to break the Jamaat network here before they move on to their respective objectives in Tblisi.', 1, '2013-11-09 16:15:00'),
(9, 'RESULTS OF OPERATION ICEBREAKER', 'HUMINT', 'Intel collation now makes it clear we have at least three different Jamaat cells in place in the area, going by the names Ta''lab, Tawr and Asad, but we believe there are additional units operating.\r\n\r\nOperations conducted on saturday yielded several explosive devices and rocket propelled grenade launchers confiscated or neutralized, and several key personel captured, among them HVT GLOWWORM. Glowworm has provided valuable intelligence so far-\r\n\r\nWe can now confirm that the Jamaat is planning a several simultaneous attacks against the trade fair Expo 2013 in Tblisi in late novemer this year. The means of attack are yet unknown, but BRAVO LIMA was able to capture several canisters of what we believe is (RS)-Propan-2-yl methylphosphonofluoridate, also known as Sarin. \r\n\r\nJITFCOM has struck a severe blow to the continued operations of Jamaat, but there are still units at large and possible weapon systems and ordnance still being prepared before the attack. We believe Jamaat will try to assemble the delivery systems and materiel tomorrow in preparation for attack. \r\n', 1, '2013-11-09 21:11:44');
