(1, 13, 'Orders: OP', '', 'Move out to grid reference 33VVD915789 and establish an observation post overlooking the small path there. Report any activity to LIMA XRAY. Stay until further notice.', '2013-11-08 14:26:10', 1),
(2, 13, 'Orders: OP', '', 'Move out to grid reference 33VVD921787 and establish observation post overlooking the small dirth path there.\r\n\r\nReport any activity to LIMA XRAY. Establish comms with CHARLIE LIMA to the west of you and collate information.\r\n\r\nStay until further notice.', '2013-11-08 14:29:37', 1),
(3, 13, 'Orders: Sweep', '', 'Link up BRAVO, ECHO, FOXTROT LIMA and head out to railroad bridge at grid reference 33VVD911805 to perform combat sweep of the peninsula stretching to the southwest of that position.\r\n\r\nKeep a sharp eye out for IEDs. Report on contact and when sweep is complete.\r\n\r\nLIMA XRAY out.', '2013-11-08 14:38:55', 1),
(4, 7, 'peninsula stretching', '', 'Echo lima here.\r\n\r\n3 of our guys have sweep from the railroad bridge and down the railroad tracks.\r\nWe will now gather up, and sweep the peninsula stretching.\r\n\r\nwe have not meet any frindly troops so far.\r\n\r\nEcho out.', '2013-11-08 16:12:58', 1),
(5, 3, 'Alpha Lima requesting info', '', 'We bred your radio frequency / channel för comms we got än OP to the east of you', '2013-11-08 16:20:53', 1),
(6, 3, 'Alpha Lima on point', '', 'We have succeded to get to 33VVD921787 and established a OP. No radio contact with Charlie Lima yet.\r\n\r\n', '2013-11-08 16:23:53', 1),
(7, 13, 'Alpha Lima on point', '', 'Roger, ALPHA LIMA. CHARLIE LIMA delayed, will contact you with ETA once we establish radio contact.', '2013-11-08 16:39:13', 1),
(8, 13, 'FOXTROT LIMA approaching', '', 'According to SATNAV FOXTROT LIMA should be approaching you from the direction of the railroad bridge. See if you can raise on radio.', '2013-11-08 16:51:52', 1),
(9, 2, '2x MAM spotted ', '', 'Crossing the bridge going east time 1644', '2013-11-08 17:13:30', 1),
(10, 13, '2x MAM', '', 'Roger, PAPA ROMEO. SIGINT just noticed a a cell phone connection we''re watching for in your proximity. Keep alert and watch for any movement. If possible follow but do not engage.', '2013-11-08 17:17:10', 1),
(11, 7, 'friendly contact', '', 'echo and foxtrot are now together at echo limas car position.\r\n\r\nhalf of echo squard are still sweeping the area close to the yellow sweep mark on the map.\r\n\r\nout  ', '2013-11-08 17:20:53', 1),
(12, 7, 'testing', '', 'This is Echo lima.\r\nTesting the massage system, do you get this massage?\r\nSnake out.', '2013-11-08 17:40:05', 1),
(13, 7, 'sweep complete', '', 'Echo lima have finished  the sweep on peninsula stretching.\r\nNothing to report.\r\nwe are still together with foxtrot.\r\n\r\nDo you want us to go to a specifik point or should we try to sweep around the area.\r\n\r\nEcho ', '2013-11-08 18:01:21', 1),
(14, 13, 'New orders', '', 'Sweep confirmed. Move out together to sweep grid 33VVD937792 (position marked as "Cell Phone 1"), then move on to sweep quarry at grid reference 33VVD940781.\r\n\r\nGood work ECHO and FOXTROT. We are awaiting the arrival of CHARLIE and BRAVO, will update when they are oscar mike. ', '2013-11-08 18:09:13', 1),
(15, 7, 'mission ', '', 'we have recieved the mission and will move to cell phone 1 position,\r\n\r\nout', '2013-11-08 18:16:01', 1),
(16, 2, '2 vehicles ', '', '2 vehicles with fot soldiers spotted north  of the river. Seems to be searching ', '2013-11-08 18:37:59', 1),
(17, 13, 'Vehicles', '', 'Roger that, Papa Romeo. Vehicles are elements of the JITF, consider blue, repeat blue.\r\n\r\nWhat''s your status, over?', '2013-11-08 18:41:29', 1),
(18, 13, 'Status?', '', 'ALPHA LIMA, sitrep?', '2013-11-08 19:01:35', 1),
(19, 7, 'new orders', '', 'cell phone one is sweeped. nothing to report.\r\n(off game massage, the owner of the house at the cell phone one koordinat were a bite pist of our present. but we talked to him and moved away. just so you know it)\r\n\r\nwe are now sweeping 33VVD940781.', '2013-11-08 19:05:46', 1),
(20, 2, 'status', '', 'We  have  a OP observing  the bridge. No activity  at  the moment. ', '2013-11-08 19:08:29', 1),
(21, 3, 'status', '', 'We have heard movement close to our op and have seen what we. Believe is flashlight from the other side of the road.', '2013-11-08 19:14:12', 1),
(22, 13, 'Status', '', 'Roger that. Hold position and keep observing. Are you able to hold position over night or do you need to relocate?', '2013-11-08 19:18:06', 1),
(23, 7, 'car spottet', '', '33VVD937782\r\n car spottet. black 4x4\r\npicture on the way\r\nno aktivity', '2013-11-08 19:20:07', 1),
(24, 13, 'Status update', '', 'Roger that. We''ve received reports of sightings on uknown armed persons about a click east of your position, possibly heading your way.\r\n\r\nECHO and FOXTROT will move to investigate and will push from the east, possibly driving unknown armed persons towards you.', '2013-11-08 19:22:18', 1),
(25, 13, 'Vehicle', '', 'Roger that ECHO LIMA. Good work. Forwarding intel to INT when we receive it.', '2013-11-08 19:23:47', 1),
(26, 3, 'comms', '', 'Roger were waiting here', '2013-11-08 19:28:52', 1),
(27, 2, 'status', '', 'Roger that. We  will  hold  this OP til  00.00. Then  we  need to resupply and get some  sleep.\r\nOver.', '2013-11-08 19:30:15', 1),
(28, 7, 'ECHO LIMA - ECHO_LIMA_2013-11-08_19_32_16.jpg', NULL, 'User ECHO LIMA uploaded  <a href=''http://milsim.se/icebreaker/artemis/assets/uploads/ECHO_LIMA_2013-11-08_19_32_16.jpg''>ECHO_LIMA_2013-11-08_19_32_16.jpg</a> at 2013-11-08 19:32:16 </a>', '2013-11-08 19:32:16', 1),
(29, 7, 'ECHO LIMA - ECHO_LIMA_2013-11-08_19_32_23.jpg', NULL, 'User ECHO LIMA uploaded  <a href=''http://milsim.se/icebreaker/artemis/assets/uploads/ECHO_LIMA_2013-11-08_19_32_23.jpg''>ECHO_LIMA_2013-11-08_19_32_23.jpg</a> at 2013-11-08 19:32:23 </a>', '2013-11-08 19:32:23', 1),
(30, 13, 'New order', '', 'You may re-supply now and continue the OP at 0600 tomorrow.', '2013-11-08 19:33:06', 1),
(31, 5, 'charlie lima requesting orders', '', '', '2013-11-08 19:55:15', 1),
(32, 5, 'charlie lima requesting orders', '', '', '2013-11-08 19:55:15', 1),
(33, 2, 'Roger that ', '', 'Roger that ', '2013-11-08 20:11:01', 1),
(34, 13, 'Standing order', '', 'Move to point "Observe" MGRS 33VVD916790\r\n\r\nIntel about route being used for drug muling. Collect evidence.\r\n\r\nAlpha Lima have OP close by.', '2013-11-08 20:14:48', 1),
(35, 3, 'activity', '', 'We heard about 2 people moving on the road heading to the west. Unknown personnel', '2013-11-08 20:30:56', 1),
(36, 13, 'Information.', '', 'Roger.\r\nNo JITF-personell other than you. Charlie Lima on the way, have night capabilities. Keep position, if possible stop any suspects leaving the same route.', '2013-11-08 20:34:57', 1),
(37, 13, 'Position?', '', 'Alpha Lima have had visual and audioal on suspects on their position, on their way out on the cape. Possible to follow?', '2013-11-08 20:36:50', 1),
(38, 5, 'position', '', 'At 33vvd916790 moving south ', '2013-11-08 20:59:54', 1),
(39, 13, 'New order', '', 'Find place for night camp. Wait for rest of your team. New orders in the morning. \r\nReport coordinates when you have established camp.', '2013-11-08 21:10:30', 1),
(40, 13, 'SITREP', '', 'Status? Position?', '2013-11-08 21:27:44', 1),
(41, 3, 'charlis locatiin', '', 'What''s Charlie limas location we just heard coughing just some meters infront of us. We are only 2 people awake atm the others are resting.', '2013-11-08 21:27:58', 1),
(42, 13, 'Charlie Limas position.', '', 'Last known position MGRS 33VVD916789 at least 500m from your position.', '2013-11-08 21:31:43', 1),
(43, 5, 'in position ', '', 'At observe. Heard movement along path towards west while on route but not in position to observe. ', '2013-11-08 21:51:51', 1),
(44, 13, 'Affirmative', '', 'Hold position and observe.', '2013-11-08 21:55:34', 1),
(45, 7, 'position', '', 'echo here.\r\nmoving against cell phone 2.\r\naktuel position, look at the car gps.\r\n\r\nout.', '2013-11-08 21:56:52', 1),
(46, 7, 'moving', '', 'echo here. we are moving toward  cell phone 2\r\n\r\njtf out', '2013-11-08 21:57:50', 1),
(47, 13, 'Affirmative', '', 'Roger, ECHO LIMA. BRAVO LIMA is en route to that position as well, check your fire.', '2013-11-08 21:58:49', 1),
(48, 13, 'Resume OP', NULL, 'Resume OP at previous location at grid reference 33VVD937792 and await further instructions. Intel says there might be a drop at this location early morning so stay frosty.', '2013-11-09 05:33:42', 1),
(49, 13, 'USAF INTEL - DOWNED UAV', 'INTEL', 'We just received a flash from USAF, reporting they''ve lost contact with one of their UAV survaillance drones patrolling the area.\r\n\r\nUSAF believes the UAV has been shot down. We are tasked with supporting USAF in finding the UAV, and to recover the flight recorder and radio crypto module it contains. Be prepared to move out on short notice if we get a fix on the crash site.', '2013-11-09 05:31:37', 1),
(50, 13, 'Order: Search', 'JITFCOM', 'Support USAF. Search from your current position, heading west, to grid reference 33VVD907814.\r\n\r\nWe are looking for a crash site or wreckage parts from an MQ-9 Reaper Unmanned Aerial Vehicle.\r\n\r\nMove out southwest to the railroad bridge at grid reference 33VVD911804 and sweep south west to grid 33VVD909802.', '2013-11-09 06:12:11', 1),
(51, 13, 'Order: Search', 'ORDER', 'Support USAF. Search from grid reference 33VVD918791 to grid 33VVD916800.\r\n\r\nWe are looking for a crash site or wreckage parts from an MQ-9 Reaper Unmanned Aerial Vehicle.', '2013-11-09 06:05:16', 1),
(52, 13, 'Order: Search', 'ORDER', 'Support USAF. Strike east to the rail road and search northeast to grid reference 33VVD925797.\r\n\r\nWe are looking for a crash site or wreckage parts from an MQ-9 Reaper Unmanned Aerial Vehicle.', '2013-11-09 06:06:48', 1),
(53, 13, 'Order: Search', 'ORDER', 'Support USAF. Head out to the crossroads at grid reference 33VVD925797 and dismount. Search by foot north, following the dirt path to grid reference 33VVD928804.\r\n\r\nWe are looking for a crash site or wreckage parts from an MQ-9 Reaper Unmanned Aerial Vehicle.', '2013-11-09 06:14:07', 1),
(54, 13, 'Order: Search', 'ORDER', 'Support USAF. Move to grid reference 33VVD931779 and dismount, search the field and northern forest, up to grid reference 33VVD931764.\r\n\r\nWe are looking for a crash site or wreckage parts from an MQ-9 Reaper Unmanned Aerial Vehicle.', '2013-11-09 06:07:05', 1),
(55, 2, 'status', '', 'Observing  the bridge, nothing  to report  so far.\r\nOver.', '2013-11-09 06:48:33', 1),
(56, 3, 'roger', '', 'Roger that we''ve had people walking in between the sleeping place and the op this night so they know were here somewhere', '2013-11-09 06:51:19', 1),
(57, 13, 'Check your GPS', '', 'GEOINT has lost contact with your GPS-tracker, you need to check the powers source and reset it:\r\n1) Reconnect power cable between GPS and car\r\n2) Hold power button until the red light flashes\r\n3) Release power button and wait 20 seconds\r\n4) Hold power button until blue or green light flashes', '2013-11-09 07:38:46', 1),
(58, 2, 'status OP', '', '1 vehicle stoped  at the bridge. 1 man  visuel.', '2013-11-09 08:05:28', 1),
(59, 13, 'Op status.', '', 'Photo opportunities?', '2013-11-09 08:08:09', 1),
(60, 7, 'support usaf', '', 'Have any lima groups search for the mq-9? Between 3VVD925797 & 33VVD928804.\r\n\r\nEcho', '2013-11-09 08:11:22', 1),
(61, 2, 'photos ', '', 'Will send  soon . Need to to relocate position.', '2013-11-09 08:12:34', 1),
(62, 13, 'Re: Support USAF.', '', 'Negative. This is your area.', '2013-11-09 08:17:17', 1),
(63, 13, 'Radio communication.', '', 'We will change radio frequency to 156 000 MHz, confirm that you are able to do that. But don´t change yet.', '2013-11-09 08:24:33', 1),
