(69, 5, 'affirmative', '', 'Standing by on changing comms ', '2013-11-09 08:34:48', 1),
(70, 2, 'PAPA ROMEO - PAPA_ROMEO_2013-11-09_08_35_30.jpg', NULL, 'User PAPA ROMEO uploaded  <a href=''http://milsim.se/icebreaker/artemis/assets/uploads/PAPA_ROMEO_2013-11-09_08_35_30.jpg''>PAPA_ROMEO_2013-11-09_08_35_30.jpg</a> at 2013-11-09 08:35:30 </a>', '2013-11-09 08:35:30', 1),
(71, 2, '', '', 'The frequency is a no go', '2013-11-09 08:42:08', 1),
(72, 4, 'radio communications', '', 'check... we can change to 155.000\r\n\r\nBravo Lima', '2013-11-09 08:54:50', 1),
(73, 2, 'status OP', '', 'The vehicle  just left heading  west ', '2013-11-09 08:58:37', 1),
(74, 13, 'Re: status OP', '', 'Roger that.\r\n\r\nDid the vehicle drop off or pick up anything?\r\n\r\nDo we have any more intel on possible persons in the grid?', '2013-11-09 09:03:24', 1),
(75, 13, 'Radio change', '', 'All further radio communication should be on 155.525 MHz, that you already have programmed.', '2013-11-09 09:12:20', 1),
(76, 2, 'status OP', '', 'Not  sure . We can  search the area?\r\nOver ', '2013-11-09 09:16:30', 1),
(77, 7, 'mq-9', '', 'Roger that, we will move out in 15 min.', '2013-11-09 09:20:18', 1),
(78, 13, 'New order', '', 'Move covert to grid reference MGRS 33VVD920800, set up OP over the cross roads. SIGINT has noticed communication interference in the general area. Report on arrival.', '2013-11-09 09:22:28', 1),
(79, 2, 'confirmed', '', 'Moving to 33VVD920800.\r\nReporting ön arrival, over and out ', '2013-11-09 09:27:09', 1),
(80, 7, 'radio canal', '', 'we are changing to 155.525 MHz\r\nout.', '2013-11-09 09:28:26', 1),
(81, 4, 'comms', '', 'We have zero radiocomms with LX.\r\nAre you receiving our transmissions?', '2013-11-09 09:37:39', 1),
(82, 13, 're: comms', '', 'No radio contact.\r\n\r\nResume order from this morning, sweep coordinates according to order.', '2013-11-09 09:40:15', 1),
(83, 2, 'fired  upon', '', 'Got  fired  upon by not identified  soldiers trying  to cross road 31. No casulties.', '2013-11-09 09:51:33', 1),
(84, 2, 'fired  upon', '', 'Got  fired  upon by not identified  soldiers trying  to cross road 31. No casulties.', '2013-11-09 09:51:33', 1),
(85, 13, 're: fired upon', '', 'Pursue but do not engage.', '2013-11-09 09:53:23', 1),
(86, 8, 'who shot the early bird?', '', 'foxtrot lima had a bit of a issue with our alarm clock. \r\nwe are currently working on supplying our labtop with constant power in our car.\r\n10 m from now we will head out on drone mission.', '2013-11-09 09:54:42', 1),
(87, 13, 'Acknowledged', '', 'Roger that FOXTROT. Other LIMA elements are conducting sweeps at other locations.', '2013-11-09 09:59:30', 1),
(88, 13, 'FLASH ORDER CHANGE', '', 'USAF SIGINT just notified us the downed MQ-9 Reaper UAV started transmitting emergency telemetry. Coordinates on map in ARTEMIS.\r\n\r\nNew order: All LIMA, converge on UAV position and secure UAV.\r\n\r\nLast reported position for UAV is 33VVD921805.', '2013-11-09 10:04:10', 1),
(89, 7, 'mq-9', '', 'Roger new position of mq-9.\r\nwe will go to that position now.\r\n\r\necho out', '2013-11-09 10:10:14', 1),
(90, 13, 'UAV SECURITY BREACH', '', 'For your information: USAF SIGINT reports security breach in UAV communication protocol. Looks like hostiles are trying to break into the downed UAV firmware. This information is classified.\r\n\r\nUSAF is trying to scramble air support for CAS, but no word on ETA or availability yet.', '2013-11-09 10:11:48', 1),
(91, 13, 'Re: mq-9', '', 'Roger that, ECHO LIMA.', '2013-11-09 10:12:22', 1),
(92, 7, 'mq-9 found', '', 'mq-9 is found.\r\n\r\nshould we bring it to sypplu area?', '2013-11-09 10:20:53', 1),
(93, 13, 'MQ-9', '', 'Roger, ECHO LIMA. Good work!\r\n\r\nIs the transponder still in the UAV? It should be an orange box. Load UAV in your vehicle and deliver it to the resupply point later, but confirm that the transponder is still intact in the UAV. If not: sweep area and find the transponder. USAF SIGINT seems to think it has been tinkered with, and you might have hostiles hiding in the area.', '2013-11-09 10:23:20', 1),
(94, 7, 'mq-9', '', 'no orange box.\r\n\r\nwe will sweep the area.\r\n\r\nwe have bravo and foxtrot lima at our position.\r\n\r\n', '2013-11-09 10:26:25', 1),
(95, 13, 'USAF FLYBY', '', 'FYI: USAF managed to scramble a jet to do a flyby of the UAV crash site. ETA is 30 minutes. After that we should be able to pinpoint any thermal signatures in your immediate area and update your ARTEMIS map with contacts.', '2013-11-09 10:26:59', 1),
(96, 7, 'mq-9', '', 'Roger that.\r\n\r\nwe have made a road block, bravo lima in one end and foxtrot in the other end of the road near the crash side.\r\nEcho is sweeping the forrest to the north of the crash side.\r\n\r\necho out', '2013-11-09 10:33:39', 1),
(97, 13, 'MQ-9', '', 'Roger that, ECHO LIMA. ETA on jet flyby is now 22 minutes.', '2013-11-09 10:35:03', 1),
(98, 3, 'cintact report', '', 'We got contact åt the place where the UAV was found', '2013-11-09 10:40:02', 1),
(99, 7, 'enemy', '', 'We have enemy contact at the north part of the forrest from the crash side of mq-9.', '2013-11-09 10:41:07', 1),
(100, 7, 'ied found', '', 'we have found an ied in the forrest near  crash side.\r\n\r\nwhat to do with it?\r\n\r\nThere is also an rpg.\r\n\r\necho', '2013-11-09 10:46:58', 1),
(101, 13, 'IED', '', 'If possible, capture RPG and use it (if possible) to destroy the IED. Bring both, if you manage to disable them, to the resupply point. ', '2013-11-09 10:49:45', 1),
(102, 5, 'position', '', 'At approx 33vvd918804 moving east', '2013-11-09 10:51:50', 1),
(103, 7, 'ied rpg enemy', '', '3 enemies have been killed.\r\n\r\nWe have 3 bikes, 1 rpg mounted at one of the bikes.\r\n\r\nWe try to shoot the ied with the other rpg.\r\n\r\nAny orders about the bikes?', '2013-11-09 10:54:13', 1),
(104, 13, 'enemy', '', 'Excellent work, LIMA. Capture RPGs, leave the bikes. Gather intelligence and photograph KIAs, over.', '2013-11-09 10:56:37', 1),
(105, 13, 'FLYBY COMPLETE', '', 'Flyby just completed. Updating ARTEMIS with thermal signatures. Activity in the woods to the south east.', '2013-11-09 10:57:33', 1),
(106, 5, 'west of thermal sig 1', '', 'Moving east towarfs signal ', '2013-11-09 11:03:57', 1),
(107, 13, 'Roger', '', 'ROger, CHARLIE. Proceed in direction of THERMAL SIGNATURE 2.', '2013-11-09 11:04:55', 1),
(108, 7, 'mq-9 box, rpg, ied', '', 'we can''t found the orange box.\r\n\r\nwe have rpg and the destroyed ied.\r\n\r\nwe will bring the stuff to the supply point now.', '2013-11-09 11:05:35', 1),
(109, 7, 'roger that charlie', '', 'echo out.', '2013-11-09 11:06:18', 1),
(110, 13, 'Thermal signatures', '', 'Roger ECHO. Is FOXTROT or BRAVO checking the other thermal signatures?', '2013-11-09 11:07:24', 1),
(111, 7, '.', '', 'Foxtrot is moving with us.\r\n\r\nbravo is regrouping, and they have a prisoner.', '2013-11-09 11:11:12', 1),
(112, 5, 'CHARLIE LIMA - CHARLIE_LIMA_2013-11-09_11_30_24.jpg', NULL, 'User CHARLIE LIMA uploaded  <a href=''http://milsim.se/icebreaker/artemis/assets/uploads/CHARLIE_LIMA_2013-11-09_11_30_24.jpg''>CHARLIE_LIMA_2013-11-09_11_30_24.jpg</a> at 2013-11-09 11:30:24 </a>', '2013-11-09 11:30:24', 1),
