(117, 13, 'UAV TRANSPONDER ACTIVATED', '', 'UAV TRANSPONDER ACTIVATED, USAF-UAV268 is now active, see map. Retrieve transponder and deliver to LZ/Resupply point. Take caution, tango in area, look out for ambushes.', '2013-11-09 11:44:09', 1),
(118, 13, 'Order, blocking move.', '', 'Move to a position MGRS 33VVD924799\r\nSpread out in terrain, block any fleeing Jamaat-forces.', '2013-11-09 11:44:11', 1),
(119, 5, 'image of op', '', 'Op with separate antenna in field right between thermal sig 1 and 2', '2013-11-09 11:44:43', 1),
(120, 13, 'POINT UPDATED', '', 'Updated your point on the map', '2013-11-09 11:47:19', 1),
(121, 13, 'Position?', '', 'Whats your current MGRS-position.', '2013-11-09 11:50:53', 1),
(122, 3, 'position', '', 'Were close to the enemy cache and is heading to its position', '2013-11-09 12:00:12', 1),
