(128, 3, 'picturrs', '', 'Pictures of a dead enemy uploaded', '2013-11-09 12:50:04', 1),
(129, 13, 'INTEL RECEIVED', '', 'Copy your photos, ALPHA LIMA. Status of KIAs, and your sitrep and position? Search bodies and secure any intel if found.', '2013-11-09 12:50:19', 1),
(130, 7, 'uav268', '', 'Has the  transponder been Retrieved?\r\n\r\nEcho', '2013-11-09 12:57:00', 1),
(131, 3, 'sitrep', '', 'Were a bit to the east of the block point. No casualties but we hear movement ahead of us. Contact from behind right now.', '2013-11-09 12:57:12', 1),
(132, 13, 'Re: UAV268', '', 'Negative, ECHO LIMA. Transponder is stationary, do you have it on-map in ARTEMIS? Located north of your position and needs to be retrieved. ', '2013-11-09 12:59:10', 1),
(133, 7, 're uav 268', '', 'Yes we have it on the map.\r\n\r\nWe have enemy contact close to the cars position now.\r\n\r\nSo we can''t move on yet.\r\n\r\nEcho', '2013-11-09 13:01:44', 1),
(134, 3, '', '', '', '2013-11-09 13:09:23', 1),
