(140, 13, 'sweep', '', 'Roger that CHARLIE LIMA. Move on to Thermal Signature 3 and link upw ith FOXTROT LIMA if possible. There is a UAV transponder two grids north of thermal signature 3 that needs to be recovered.', '2013-11-09 13:26:33', 1),
(141, 8, 'Pick-up', '', 'We need pickup at helisite ASAP.!', '2013-11-09 13:43:29', 1),
(142, 13, 'Heli pick up.', '', 'Roger that, radio in when secure.', '2013-11-09 13:47:32', 1),
