(150, 2, 'position', '', 'Headed  för the OP. Met lots of enemies in the woods . 2 vehicles aswell . ', '2013-11-09 13:57:42', 1),
(151, 3, 'prisoner transport', '', 'We need a transport to 33VVD934793', '2013-11-09 13:59:18', 1),
(152, 13, 'ARTEMIS SECURITY BREACH', '', 'Investigation show that the earlier security breach in ARTEMIS is due to Jamaat operatives capturing the UAV transponder, facilitating decryption of NATO communication protocols for this sector. The problem has now been rectified, but OPSEC is now believed to be breached - meaning that anything posted earlier in ARTEMIS is now known to Jamaat.\r\n\r\nMeasures have been taken to make sure this cannot happen again.\r\n\r\nThe UAV transponder is still out in the field, sending telemetry, and priority one is to capture and return it to the Resupply Point. It is still visible in the ARTEMIS map, and seems to be moving, suggesting that it is in the hands of a Jamaat unit.', '2013-11-09 15:05:14', 1),
(153, 13, 'NEW ORDERS: OP', '', 'Move out ASAP and set up OP at grid reference 33VVD932795 in preparation for next operative phase. More orders to follow.', '2013-11-09 15:17:21', 1),
(154, 13, '', '', 'Move out ASAP and set up OP at grid reference 33VVD931798 in preparation for next operative phase. More orders to follow.', '2013-11-09 15:17:57', 1),
(155, 2, 'uav ', '', 'We are very  close to the UAV  position. ', '2013-11-09 15:27:32', 1),
(156, 13, 're: uav', '', 'Report back when you are in possession of the tav transponder.', '2013-11-09 15:31:51', 1),
(157, 5, 'priorities', '', 'Is it more important that we get the op up quickly or that we can maintain it during the night. Dropped packs when flash about uav was received. ', '2013-11-09 15:36:41', 1),
(158, 13, 're: priorities', '', 'Quickly, not over night.', '2013-11-09 15:38:19', 1),
(159, 13, 'Await new orders', '', 'Halt, R&R until further notice.', '2013-11-09 15:40:58', 1),
(160, 13, 'Position?', '', 'Whats your exact MGRS-position right now?', '2013-11-09 15:41:41', 1),
(161, 2, 'Roger that ', '', '', '2013-11-09 15:46:46', 1),
(162, 2, 'position ', '', '33VVD923805', '2013-11-09 15:51:12', 1),
(163, 13, 'New order', '', 'INTEL has notified us that interrogation with HVT GLOWWORM has revealed that Jamaat will have a meeting of most units present at grid reference 33VVD937797 at 1630 hours.\r\n\r\nJITF forces will be notified when we are certain of Jamaat units moving to the meeting point. \r\n\r\nYour orders are to move quickly, in as short a route as possible to observe and, if possible, neutralize Jamaat troops. \r\n\r\nBeware of JITF OPs in grids 33VVD931798 and 33VVD932795, but if necessary you are clear to go visible.', '2013-11-09 16:05:47', 1),
(164, 4, 'Orders?', '', 'Bravo Lima is patroling the area. no sign of enemy activity.\r\n\r\nany aditional orders?', '2013-11-09 16:13:03', 1),
(165, 5, 'op established ', '', '', '2013-11-09 16:13:34', 1),
(166, 13, 're: op established', '', 'Roger. Alpha and Charlie, dig in and hold the OP:s. ', '2013-11-09 16:30:11', 1),
(167, 2, 'eta  30 min', '', 'Status on mission?', '2013-11-09 17:29:11', 1),
(168, 5, 'nothing at op', '', 'We cant maintain op without additional gear. Breaking op', '2013-11-09 17:34:09', 1),
(169, 13, 'RE: Eta 30 min', '', 'SNAFU at target coordinates. JITF elements have captured unknown weapon systems and ordnance but lost contact with Jamaat troops. SIGINT just reported multiple cell phone contacts at your original target coordinates (the meeting point), so mission still stands. Approach for search and destroy.', '2013-11-09 17:34:18', 1),
(170, 13, 'Roger', '', 'Roger, CHARLIE. Where is your return location?', '2013-11-09 17:34:48', 1),
(171, 5, 'destination', '', 'Packs at 33vvd918797', '2013-11-09 17:39:05', 1),
(172, 2, 'pappa romeo', '', 'Foxtrot  lima , this is papa  romeo. We Will cross your  pos . Eta  5 min. Dont  shoot . Copy  over ', '2013-11-09 17:44:58', 1),
(173, 5, 'at packs', '', 'Any new orders?', '2013-11-09 18:17:11', 1),
(174, 13, 'Orders', '', 'Find cover and take som R&R, JITF is consolidating. New orders will arrive but you should be able to get some rest.', '2013-11-09 18:27:28', 1),
(175, 2, 'status', '', 'We are totally  soaked. We will probably not go out  anymore  today. \r\nOver ', '2013-11-09 18:37:53', 1),
(177, 13, 'SITREP?', '', 'Is the pizza any good?', '2013-11-09 18:49:14', 1),
(178, 13, 'Night orders', '', 'Roger, PAPA ROMEO. Find shelter and hunker down.\r\n\r\nOrders for tomorrow are: JITFCOM needs eyes on the road at grid 33VVD931779 at 0500 hours. Be on the lookout for vehicles or known militants meeting in this area. \r\n\r\nIf you can identify the vehicle as the pickup you took earlier, orders are to laser designate the vehicle for cruise missile strike. Keep laser on target for at least 10 minutes and notify JITFCOM and we will call in the strike.', '2013-11-09 18:50:26', 1),
(179, 13, 'SITREP', '', 'Report status and combat readiness. Further actions for the evening, night and morning according to your combat readiness.', '2013-11-09 18:59:06', 1),
(180, 7, 'Italian supplies', '', 'Still awaiting dropoff ', '2013-11-09 19:05:54', 1),
(181, 7, 'Italian supplies', '', 'Still awaiting dropoff ', '2013-11-09 19:05:54', 1),
(182, 7, 'ECHO LIMA - ECHO_LIMA_2013-11-09_19_17_17.jpg', NULL, 'User ECHO LIMA uploaded  <a href=''http://milsim.se/icebreaker/artemis/assets/uploads/ECHO_LIMA_2013-11-09_19_17_17.jpg''>ECHO_LIMA_2013-11-09_19_17_17.jpg</a> at 2013-11-09 19:17:17 </a>', '2013-11-09 19:17:17', 1),
(183, 2, '', '', 'We aim for it!\r\nOut ', '2013-11-09 19:28:34', 1),
(184, 13, 're: ', '', 'Roger, good night PAPA ROMEO. Report in when you wake up.', '2013-11-09 19:30:47', 1),
(185, 7, 'status report', '', 'R&R in progress.\r\n\r\nWe are ready for missions from 21.00.\r\n\r\nECHO Out\r\n', '2013-11-09 19:32:47', 1),
(186, 5, 'sitrep', '', 'Partly fed and trying to stay warm. One man cold and wet and wants to set camp for the night.', '2013-11-09 19:38:16', 1),
(187, 13, 'Sitrep', '', 'Copy that, CHARLIE. If two of you want to attach to BRAVO, ECHO or FOXTROT we can probably set that up.', '2013-11-09 19:42:12', 1),
(188, 4, 'Status ', '', 'We have combatrediness 3 on a scale of fine.\r\nSome nightcapability but troops seem ready to go into nightsleep. \r\nWe are fightready at 0800 sunday.\r\nWe can do nightmission if needed.\r\nBut we are pretty satisfied as is. ', '2013-11-09 19:49:53', 1),
(189, 13, 'Sitrep', '', 'Roger, BRAVO LIMA. Operators with capability can prepare for night mission at 0500, remaining operators can be prepared to move at 0800 to support other LIMA teams. Get an early night and report in when you go online again. Xray out.', '2013-11-09 19:53:03', 1),
(190, 5, 'setting camp', '', 'We have concluded that the weather makes our night vision equipmen inefficcient and we cant operate properly. We will therefore set camp as a whole team ', '2013-11-09 20:17:30', 1),
(191, 8, 'combat ready', '', 'we are good to go.. just need some time to gear up..', '2013-11-09 20:32:00', 1),
(192, 7, 'Status', '', 'X-ray are there mission planed for to night?\r\nEcho.', '2013-11-09 20:36:58', 1),
(193, 13, 'Night camp', '', 'Roger, CHARLIE LIMA. Recon mission at 0500, report back when you go online again.', '2013-11-09 20:40:49', 1),
(194, 13, 'Roger', '', 'Roger that, FOXTROT LIMA. Stand by for new orders. We have ECHO LIMA also going online at this time.', '2013-11-09 20:41:30', 1),
(195, 7, 'ECHO LIMA - ECHO_LIMA_2013-11-09_20_42_02.jpg', NULL, 'User ECHO LIMA uploaded  <a href=''http://milsim.se/icebreaker/artemis/assets/uploads/ECHO_LIMA_2013-11-09_20_42_02.jpg''>ECHO_LIMA_2013-11-09_20_42_02.jpg</a> at 2013-11-09 20:42:02 </a>', '2013-11-09 20:42:02', 1),
(196, 13, 'Night operations', '', 'Affirmative. We have a mission for you shortly, which should not take very long, and we also have general muster for specific operation at 0500 hours.', '2013-11-09 20:42:37', 1),
(197, 13, 'INTEL', '', 'Copy your latest INT ECHO. Is that captured material?', '2013-11-09 20:44:57', 1),
(198, 7, 'channel card.', '', 'We found that on a dead enemy.\r\nTook the picture, didn''t take the card.\r\n\r\nEcho ', '2013-11-09 20:47:27', 1),
(199, 4, 'Sitrep', '', 'Soldiers want to scrub the nightmission.\r\nWhole team battleready at 0800.', '2013-11-09 20:52:55', 1),
(200, 13, 'Night orders', '', 'Fly over have revealed a heat signature. See map for reference. Make a sweep in the area. Check for Jamaat-activity. Echo Lima and Foxtrot Lima, communicate over this one.', '2013-11-09 20:53:02', 1),
(201, 13, 'Re: Sitrep', '', 'Roger that. You will have new orders by 0800, battle ready by then.', '2013-11-09 20:53:47', 1),
(202, 7, 'night order', '', 'hey guys\r\n\r\nAre you ready for the night order?\r\n\r\nEcho', '2013-11-09 20:55:07', 1),
(203, 7, 'night order', '', 'Roger that.\r\n', '2013-11-09 20:56:53', 1),
(204, 13, 'ENCRYPTED RADIO', '', 'When you have investigated THERMAL 5, investigate point ENCRYPTED RADIO SIGNALS on your ARTEMIS map. We have picked up short bursts of encrypted radio traffic there earlier and recently picked it up again. We thought earlier it might have been PAPA ROMEO, but they claim to not have been near the spot.', '2013-11-09 21:20:56', 1),
(205, 4, 'Status ', '', 'We have combatrediness 3 on a scale of fine.\r\nSome nightcapability but troops seem ready to go into nightsleep. \r\nWe are fightready at 0800 sunday.\r\nWe can do nightmission if needed.\r\nBut we are pretty satisfied as is. ', '2013-11-09 21:22:15', 1),
(206, 7, 'roger that', '', 'roger that.\r\necho', '2013-11-09 21:40:30', 1),
(207, 13, 'Thermal 5', '', 'GEOSAT says Thermal 5 is cold, but kept stationary. Looks like a small fireplace or motorcycle engine or similar.', '2013-11-09 23:18:05', 1),
(208, 13, 'Night orders', '', 'Make camp and rest after clearing ENCRYPTED RADIO SIGNALS, be ready to move out come morning. Combined operation with PAPA ROMEO and LIMA elements tomorrow. Goal is for LIMA to be oscar mike at 0530 hours.\r\n\r\nLima X-Ray is switching personnel and will be off-radio for about an hour. Log reports in ARTEMIS and confirm readiness for operation at 0530.', '2013-11-09 23:22:10', 1),
(209, 8, 'ready', '', 'we will be ready at 0530.', '2013-11-10 00:35:55', 1),
(210, 5, 'online', '', 'But need 30m to finish preparations', '2013-11-10 04:50:40', 1),
(211, 7, 'Echo lima', '', 'Echo lima ready 0530', '2013-11-10 05:08:26', 1),
(212, 7, 'Echo', '', 'Reporting in, good moorning;)\r\n\r\nStatus on 05.30?\r\n\r\nEcho', '2013-11-10 05:17:01', 1),
(213, 13, 'Orders.', '', 'Set up OP at 33VVD921794. Prepare for long haul.', '2013-11-10 05:44:37', 1),
(214, 13, 'Orders', '', 'Take a hidden position in grid reference 33VVD933779, overlooking the dirt path. \r\n\r\nWe are awaiting the arrival of enemy footpatrols from unknown directions, but we want to allow them to gather before we strike.', '2013-11-10 05:47:53', 1),
(215, 13, 'Orders', '', 'Morning, ECHO LIMA. New orders as follows: head to the large warehouse in grid reference 33VVD926784 and block that road. Stop any foot patrols trying to get by. We are trying to funnel enemy patrols into the fields southeast of that position.', '2013-11-10 05:50:01', 1),
(216, 13, 'Order clarification', '', 'Clarification, ECHO. Take a hidden position.\r\n\r\nAllow anything through going south, but not north. ', '2013-11-10 05:52:39', 1),
(217, 13, 'sitrep', '', 'Morning, ALPHA LIMA. SITREP?', '2013-11-10 05:53:16', 1),
(218, 13, 'SITREP', '', 'Position and sitrep, over.', '2013-11-10 05:53:58', 1),
(219, 13, 'SITREP', '', 'Did you have any early birds online at this time, BRAVO?', '2013-11-10 05:56:58', 1),
(220, 4, 'sitrep', '', 'Nope', '2013-11-10 06:06:49', 1),
(221, 13, 'roger', '', 'Copy that. Report in when you''re ready for action.', '2013-11-10 06:07:40', 1),
(222, 8, 'we are at the coords', '', 'we have contact with lima echo, awaiting further orders..', '2013-11-10 06:19:09', 1),
(223, 13, 'Roger', '', 'Roger that. We are picking up lots of cellphone traffic all over, so keep alert.', '2013-11-10 06:25:00', 1),
(224, 5, 'at location', '', 'What are we looking for? In which direction?', '2013-11-10 06:33:16', 1),
(225, 13, 'OP', '', 'We believe jamaat may be heading in your direction from the south. If they do, let them approch and take them out close range. ECHO will support from the south.', '2013-11-10 06:39:07', 1),
(226, 13, 'INFORMATION', '', 'Heads up. We have a suspected Jamaat force heading your way.', '2013-11-10 06:55:39', 1),
(227, 8, 'cell 7 / ther 6', '', 'we are sweeping the woods for any hostiles..', '2013-11-10 07:12:27', 1),
(228, 13, 'Roger', '', 'Copy that. Charlie is keeping OP to the north in case you flush out hostiles.', '2013-11-10 07:14:24', 1),
(229, 7, 'Echo', '', 'Echo here. Our iphone has fucked up the koordinat you gav us. We are totaly wrong placed. we will move to the warehouse at the trainstation.\r\nunless you want us else were.\r\n\r\necho', '2013-11-10 07:27:49', 1),
(230, 13, 're: Echo', '', 'The order is still valid, go to grid ref. 33VVD926784', '2013-11-10 07:30:49', 1),
(231, 7, '.', '', 'Roger that, we are at that position now.\r\n\r\nEcho', '2013-11-10 07:40:51', 1),
(232, 3, 'sitrep', '', 'We have woken and eaten an soon ready to move out. SL decided we should rest since the morale was low. We are ready to move in a min.', '2013-11-10 08:32:57', 1),
(233, 13, 'Position?', '', 'Gridreferens (MGRS)?', '2013-11-10 08:35:46', 1),
(234, 13, 'Order.', '', 'Almost all forces on tali-hunt south of LZ. Can you meet up?', '2013-11-10 08:36:36', 1),
(235, 3, 'location', '', 'Were southeast of LZ exact position unknown but we just heard explosions up ahead. Well keep moving', '2013-11-10 09:07:51', 1),
(236, 13, 'roger', '', 'Roger that, ALPHA. Explosions were BRAVO conducting EOD. ', '2013-11-10 09:08:52', 1),
(237, 7, 'thermal 7', '', 'Any news about thermal 7.\r\n\r\nWe can''t find any thing.\r\n\r\nwe are moving to thermal 8 now\r\n\r\nEch', '2013-11-10 09:28:03', 1),
(238, 5, 'trying to identify two unknowns', '', 'At railroad soutwest of op. Two individuals moving west of railroaf. Lost contact with spotter. No further info ', '2013-11-10 09:31:46', 1),
(239, 3, 'sitrep', '', 'Were at thermal Sig 7 two targets disappeared to the southeast', '2013-11-10 09:40:34', 1),
(240, 13, 'Re: Sitrep', '', 'Apprehend the subjects and report in.', '2013-11-10 09:42:37', 1),
(241, 2, 'aborting ', '', 'Papa  romeo have  to abort mmission. None  working rifles.\r\n\r\nSka vi komma förbi gården?', '2013-11-10 09:49:40', 1),
(242, 13, 'Re: Aborting', '', 'Roger Roger.\r\n\r\nKom förbi källarvinden, men rulla norrifrån så ni undviker ev. bakåll.', '2013-11-10 09:53:15', 1),
(243, 3, 'sitrep', '', 'Were åt thermal Sig 8 lost targets but will sweep area', '2013-11-10 09:55:21', 1),
(244, 13, 'Roger that', '', 'Keep the pressure on, good work.', '2013-11-10 09:58:50', 1),
(245, 2, 'aborting ', '', 'Papa  romeo have  to abort mmission. None  working rifles.\r\n\r\nSka vi komma förbi gården?', '2013-11-10 10:01:22', 1),
(246, 3, 'sitrep', '', 'Were åt 33VVD928781. Walking to northwest', '2013-11-10 10:13:49', 1),
(247, 13, 'New order', '', 'Roger, ALPHA. You can abort that pursuit unless you have contact and sweep northwest of the LZ. ECHO and FOXTROT is working in that area as well, we have multiple unconfirmed thermal signatures in that area.', '2013-11-10 10:16:22', 1),
(248, 3, 'sitrrp', '', 'Were riding with bravo now', '2013-11-10 10:31:18', 1),
(249, 3, 'thanks thanks everybody', '', 'Thanks it was alot of fun and probably one of the best milsims I''ve been to.  My team mates liked it much too !', '2013-11-10 13:07:58', 1),
(250, 13, 'Re: Thanks', '', 'Swelld to have you guys here. Return home for some well deserved r&r.\r\n\r\nGood job.', '2013-11-10 15:19:36', 1);
